import React from 'react';
//import logo from '../../img/logo-187x66.png';
import classes from './Portfolio.module.css'
import {NavLink} from "react-router-dom";
import BannerHead from "../../img/images_slider.png";

let PortfolioItem1 = () =>{
    return(
        <div className={classes.block}>
            <div className={classes.item_text}>
                <h1>portfolio</h1>
                <span className={classes.info}><NavLink to =''>Sparkle Appz</NavLink>  celebrates a wide range of successful portfolio of Mobile, Web and Unity 3D game applications for business and consumers alike.
                            <p />  We focus to deliver our expertise to our
                                clients within time and make sure that our solutions be aesthetic,
                                technically functional, user-friendly and responsive.</span>
                <button className={classes.btn}>
                    contact us today <b> &#8594;</b>
                </button>
            </div>
            <div className={classes.item_img}>
            <img src={BannerHead} alt=""/>
            </div>
        </div>
        );


};

const  Portfolio = () =>{
    return (
        <div>
            <PortfolioItem1/>

        </div>
    );
};






export default Portfolio;
